import React from 'react';

import "./Habilidades.scss";


const Skills = () => {
  // Array de habilidades y tecnologías
  const skills = [
    "HTML5", "CSS3", "JavaScript", "React.js", "Node.js", "Express.js", "MongoDB", "SQL", "Git", "RESTful APIs", "Responsive Design", "Bootstrap", "Sass/Less", "Webpack", "Jest/Enzyme", "Adobe Photoshop"
    // Puedes agregar más habilidades según sea necesario
  ];

  return (
    <section id="skills" className="section">
      <div className="container">
        <h2 className="section-title">Habilidades y Tecnologías</h2>
        <div className="skills">
          {/* Mapeo de habilidades para renderizar cada una */}
          {skills.map((skill, index) => (
            <div className="skill" key={index}>
              <i className="fas fa-check-circle"></i>
              <span className="skill-name">{skill}</span>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Skills;
